function getAccounts(accounts, network) {
  if (network === 'mainnet') {
    return {
      backupAdmin: accounts[0],
      liquidityPoolAddress: accounts[0],
      mainAdmin: accounts[0],
      contractAdmin: accounts[0],
    }
  } else if (network === 'testnet') {
    return {
      backupAdmin: accounts[0],
      liquidityPoolAddress: accounts[0],
      mainAdmin: accounts[0],
      contractAdmin: accounts[0],
    }
  } else {
    return {
      backupAdmin: accounts[2],
      liquidityPoolAddress: accounts[0],
      mainAdmin: accounts[0],
      contractAdmin: accounts[0],
    }
  }
}

async function loadInstance(instance, address, account) {
  return instance.at(address, { gasLimit: "30000" })
}


